     "Explanation": "This event is generated when activity relating to malware is detected."
   },
   {
     "sid": "38563",
     "Technique ID": "T1218",
     "Technique Name": "System Binary Proxy Execution",
     "Quotes": "\"Adversaries may bypass process and/or signature-based defenses by proxying execution of malicious content with signed, or otherwise trusted, binaries.",
     "Explanation": "The rule uses the \"fast_pattern\" and \"content\" options to look for specific patterns in the network traffic, such as \"404 Not Found\" and \"requested URL / was not found\". These patterns are commonly associated with the activity of the Win.Trojan.GateKeylogger malware, which uses a system binary (such as a web server) to proxy its execution and evade detection."
   }
 ][
